import React, { Component } from 'react'
import Sidebar from '../Sidebar/Sidebar'
import { Switch, Route } from 'react-router-dom';
import About from '../About/About';
import Service from '../Service/Service';
import Expressions from '../Expressions/Expressions';
import Inlinecss from '../InLineCssStyling/Inlinecss';
import Home from '../Home/Home';
import DashboardCss from '../DashboardCss/DashboardCss';


export default class extends Component {
    render() {
        return (
            <React.Fragment>
                <Sidebar />
                <div class="main">

                    <Switch>
                        <Route path="/" component={About} exact />
                        <Route path="/About" component={About} exact />
                        <Route path="/service" component={Service} exact />
                        <Route path="/Expressions" component={Expressions} exact />
                        <Route path='/InLineCssStyling' component={Inlinecss} />
                        <Route path='/Home' component={Home} />
                        <Route path='/DashboardCss1' component={DashboardCss} />
                    </Switch>

                </div>

            </React.Fragment>
        )
    }
}
